	              .then(response => {
	     console.log(response)

	              	setTimeout(()=>{
	              		props.history.push('/')
	              	},1000)
	              })
  return (
    <div className="logout_container"> 
        <h1>
            Sorry to see you go
        </h1>
    </div>
  )
}

export default logout;
